THE NINE LIVES OF FRITZ THE CAT nlsub


Fritz, now married and with a son, is desperate to escape from the domestic hell he now finds himself in. 
Lighting up a joint, he begins to dream about his eight other lives, hoping to find one that will provide a pleasant distraction. 
The drug-induced journeys he takes include spells as an astronaut, Hitler's psychiatrist, a courier travelling in hostile territory during a race war, 
and as a pupil of an Indian guru living in the sewers of New York

